import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import NavButtons from "../NavButtons/NavButtons.jsx";

const Skills = (props) => {
  const useStyles = makeStyles((theme) => ({
    root: {
      "& > *": {
        marginTop: theme.spacing(2),
        width: "50ch",
      },
    },
  }));
  const classes = useStyles();
  const { step, setStep } = props;
  const [values, setValues] = React.useState({
    s1: "",
    s2: "",
    s3: "",
    s4: "",
    s5: "",
    s6: "",
    s7: "",
    s8: "",
    s9: "",
    s10: "",
  });
  const [errors, setErrors] = React.useState({
    s1: false,
    s2: false,
    s3: false,
    s4: false,
  });
  const [errorMessages, setErrorMessages] = React.useState({
    s1: "",
    s2: "",
    s3: "",
    s4: "",
  });
  const [isValidated, setIsValidated] = React.useState(false);

  const onValueChange = (key, event) => {
    values[key] = event.target.value;
    setValues({ ...values });
  };
  const validateInfo = () => {
    setIsValidated(false);

    const newErrors = {
      s1: false,
      s2: false,
      s3: false,
      s4: false,
    };
    const newErrorMessages = {
      s1: "",
      s2: "",
      s3: "",
      s4: "",
    };
    if (!values.s1.length) {
      newErrors["s1"] = true;
      newErrorMessages["s1"] = "This is a required field!";
    }
    if (!values.s2.length) {
      newErrors["s2"] = true;
      newErrorMessages["s2"] = "This is a required field!";
    }
    if (!values.s3.length) {
      newErrors["s3"] = true;
      newErrorMessages["s3"] = "This is a required field!";
    }
    if (!values.s4.length) {
      newErrors["s4"] = true;
      newErrorMessages["s4"] = "This is a required field!";
    }

    setErrors({ ...newErrors });
    setErrorMessages({ ...newErrorMessages });
    setIsValidated(true);
  };
  const handleNext = () => {
    if (!Object.values(errors).includes(true)) {
      setStep(step + 1);
    }
  };
  React.useEffect(() => {
    if (isValidated) handleNext();
  }, [isValidated, handleNext]);

  return (
    <div>
      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField
              label="Name"
              variant="outlined"
              value={values.name}
              onChange={(event) => onValueChange("name", event)}
              error={errors.name}
              helperText={errors.name && errorMessages.name}
              required
            />
            <TextField
              label="E-mail"
              variant="outlined"
              value={values.email}
              onChange={(event) => onValueChange("email", event)}
              error={errors.email}
              helperText={errors.email && errorMessages.email}
              required
            />
            <TextField
              label="Phone Number"
              variant="outlined"
              value={values.pno}
              onChange={(event) => onValueChange("pno", event)}
              error={errors.pno}
              helperText={errors.pno && errorMessages.pno}
              required
            />
          </form>
        </CardContent>
      </Card>

      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField
              label="GitHub URL"
              variant="outlined"
              value={values.github}
              onChange={(event) => onValueChange("github", event)}
              error={errors.github}
              helperText={errors.github && errorMessages.github}
            />
            <TextField
              label="LinkedIn URL"
              variant="outlined"
              value={values.linkedin}
              onChange={(event) => onValueChange("linkedin", event)}
              error={errors.linkedin}
              helperText={errors.linkedin && errorMessages.linkedin}
            />
            <TextField
              label="Website URL"
              variant="outlined"
              value={values.website}
              onChange={(event) => onValueChange("website", event)}
              error={errors.website}
              helperText={errors.website && errorMessages.website}
            />
          </form>
        </CardContent>
      </Card>

      <NavButtons {...props} validateInfo={validateInfo} />
    </div>
  );
};

export default Skills;
